import React from "react";
import "../src/App.css"

function App() {
  return (
    <div className="main-page">
      <div className="todo-tab">
        <input placeholder="Add your note"></input>
        <button>+</button>
        <ol>
          <li>Buy Apple</li>
        </ol>
      </div>
    </div>
  );
}

export default App;
